import React from 'react';

function Pin({ urls }) {
    // let { urls } = props;
    return (
        <Wrapper>
            <Container>
                <img src={urls?.regular} alt="pin" />
            </Container>
        </Wrapper>
    );
}

export default Pin;


const Wrapper = styled.div`
display: inline-flex;
padding: 8px;

`
    ;

const Container = styled.div`
    display: flex;
    align-items: center;
    box-sizing: border-box;
    cursor: pointer;
    width: 236px;

    img {
        display:flex;
        width: 100%;
        border-radius: 16px;
        cursor: zoom-in;
        object-fit: cover;
    }
`;
